 \u0438 \u0440\u0430\u0437\u043B\u0443\u043A\u0430 \u0441 \u0441\u0430\u043C\u044B\u043C\u0438 \u0434\u043E\u0440\u043E\u0433\u0438\u043C\u0438...\n\u0421 \u043E\u0433\u0440\u043E\u043C\u043D\u043E\u0439 \u0433\u043E\u0440\u0435\u0447\u044C\u044E \u043C\u044B \u043D\u0430\u0431\u043B\u044E\u0434\u0430\u0435\u043C, \u043A\u0430\u043A \u043D\u0435\u0432\u0438\u043D\u043D\u044B\u0439, \"\u0431\u0435\u0441\u0444\u043E\u0440\u043C\u0435\u043D\u043D\u044B\u0439 \u043C\u043E\u0442\u043E\u043A \u0444\u0430\u043D\u0442\u0430\u0437\u0438\u0438 \u0438 \u0447\u0443\u0432\u0441\u0442\u0432\" \u0431\u0435\u0437\u0436\u0430\u043B\u043E\u0441\u0442\u043D\u043E \u0432\u044B\u0440\u044B\u0432\u0430\u0435\u0442 \u0438\u0437 \u043F\u0440\u0438\u0432\u044B\u0447\u043D\u043E\u0439 \u0436\u0438\u0437\u043D\u0438 \u0438 \u043F\u043E\u043C\u0435\u0449\u0430\u0435\u0442 \u0432 \u0430\u0442\u043C\u043E\u0441\u0444\u0435\u0440\u0443 \u043F\u043E\u043B\u043D\u043E\u0433\u043E \u0431\u0435\u0441\u043F\u0440\u0430\u0432\u0438\u044F, \u043E\u043F\u0443\u0441\u0442\u043E\u0448\u0435\u043D\u043D\u043E\u0441\u0442\u0438, \u0431\u043E\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0434\u0438\u043D\u043E\u0447\u0435\u0441\u0442\u0432\u0430 \u0431\u0435\u0437\u0436\u0430\u043B\u043E\u0441\u0442\u043D\u043E\u0435 \u0412\u0440\u0435\u043C\u044F. \u041F\u0435\u0440\u0435\u0434 \u043D\u0430\u043C\u0438 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u044E\u0442 \u0443\u0436\u0430\u0441\u0430\u044E\u0449\u0438\u0435 \u043A\u0430\u0440\u0442\u0438\u043D\u044B \u0442\u044E\u0440\u0435\u043C\u043D\u043E\u0433\u043E \u0438 \u043B\u0430\u0433\u0435\u0440\u043D\u043E\u0433\u043E \u0431\u044B\u0442\u0430: \u0433\u0440\u043E\u0445\u043E\u0442 \u043C\u0435\u0442\u0430\u043B\u043B\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u043E\u0441\u0443\u0434\u044B, \"\u0440\u0436\u0430\u0432\u044B\u0435 \u0441\u0435\u043B\u0435\u0434\u043A\u0438\", \"\u0433\u043D\u043E\u0439\u043D\u044B\u0435 \u0436\u0435\u043B\u0442\u044B\u0435 \u043B\u0430\u043C\u043F\u043E\u0447\u043A\u0438\" \u0438, \u043D\u0430\u043A\u043E\u043D\u0435\u0446, \"\u0436\u0438\u0432\u044B\u0435 \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u0438\u0435 \u043E\u0441\u0442\u0430\u043D\u043A\u0438, \u043D\u0435 \u0441\u043F\u043E\u0441\u043E\u0431\u043D\u044B\u0435 \u043D\u0435 \u0437\u0430\u0446\u0435\u043F\u0438\u0442\u044C \u0437\u0430 \u0436\u0438\u0432\u043E\u0435. \u041C\u044B\u0441\u043B\u0435\u043D\u043D\u043E \u043F\u043E\u0433\u0440\u0443\u0436\u0430\u044F\u0441\u044C \u0432 \u043F\u0440\u043E\u0438\u0441\u0445\u043E\u0434\u044F\u0449\u0435\u0435, \u043A\u0430\u043A \u0431\u044B \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u044F \u043A\u0430\u0436\u0434\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442 \u0432\u043C\u0435\u0441\u0442\u0435 \u0441 \u0422\u0430\u043C\u0430\u0440\u043E\u0439 \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u043E\u0439, \u043E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u043F\u043E\u043D\u0438\u043C\u0430\u0435\u0448\u044C, \u0447\u0442\u043E \u0432\u0441\u0435 \u0440\u0430\u0432\u043D\u043E \u043D\u0435 \u0441\u043F\u043E\u0441\u043E\u0431\u0435\u043D \u043F\u043E\u0447\u0443\u0432\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C \u0432 \u043F\u043E\u043B\u043D\u043E\u0439 \u043C\u0435\u0440\u0435 \u043D\u0435 \u0441\u0440\u0430\u0432\u043D\u0438\u043C\u044B\u0435 \u043D\u0438 \u0441 \u0447\u0435\u043C \u0441\u0442\u0440\u0430\u0434\u0430\u043D\u0438\u044F \u044D\u0442\u043E\u0439 \u043D\u0435\u043E\u0431\u044B\u0447\u0430\u0439\u043D\u043E \u0441\u0438\u043B\u044C\u043D\u043E\u0439 \u0436\u0435\u043D\u0449\u0438\u043D\u044B, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043F\u0435\u0440\u0435\u043D\u0435\u0441\u043B\u0430 \u0441\u0442\u043E\u043B\u044C\u043A\u043E, \u0441\u043A\u043E\u043B\u044C\u043A\u043E \u043D\u0435 \u043F\u0435\u0440\u0435\u043D\u0451\u0441 \u043D\u0438 \u043E\u0434\u0438\u043D \u0438\u0437 \u043D\u0430\u0441...\u0417\u0430\u0433\u043B\u0430\u0442\u044B\u0432\u0430\u044F \u043E\u0434\u043D\u0443 \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0443 \u0437\u0430 \u0434\u0440\u0443\u0433\u043E\u0439, \u044F \u0432\u0441\u0435 \u0431\u043E\u043B\u044C\u0448\u0435 \u043E\u0441\u043E\u0437\u043D\u0430\u0432\u0430\u043B\u0430 \u043D\u0435\u0437\u043D\u0430\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u043F\u0440\u043E\u0431\u043B\u0435\u043C...\u041A\u0430\u043A \u0441\u0435\u0439\u0447\u0430\u0441 \u043A\u0430\u0436\u0434\u044B\u0439 \u0441\u0442\u0443\u0434\u0435\u043D\u0442 \u0441 \u043D\u0435\u0442\u0435\u0440\u043F\u0435\u043D\u0438\u0435\u043C \u0436\u0434\u0451\u0442 \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0445 \u0447\u0438\u0441\u0435\u043B \u044F\u043D\u0432\u0430\u0440\u044F, \u043E\u043A\u043E\u043D\u0447\u0430\u043D\u0438\u044F \u0441\u0435\u0441\u0441\u0438\u0438, \u0447\u0442\u043E\u0431\u044B \u043D\u0430\u043A\u043E\u043D\u0435\u0446 \u0432\u044B\u0441\u043F\u0430\u0442\u044C\u0441\u044F, \u043E\u0442\u0434\u043E\u0445\u043D\u0443\u0442\u044C, \u0443\u0434\u0435\u043B\u0438\u0442\u044C \u0431\u043E\u043B\u044C\u0448\u0435 \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u0440\u043E\u0434\u043D\u044B\u043C \u0438 \u0431\u043B\u0438\u0437\u043A\u0438\u043C. \u0418 \u043A\u0430\u043A \u0436\u0434\u0430\u043B\u0430 \u044D\u0442\u043E\u0433\u043E \u0422\u0430\u043C\u0430\u0440\u0430 \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u0430. \u041D\u043E \u0432\u043E\u0442, 30 \u044F\u043D\u0432\u0430\u0440\u044F 1943-\u0433\u043E \u0433\u043E\u0434\u0430. \u041A\u0430\u043A \u0433\u0440\u043E\u043C \u0441\u0440\u0435\u0434\u0438 \u044F\u0441\u043D\u043E\u0433\u043E \u043D\u0435\u0431\u0430. \u0410\u0440\u0435\u0441\u0442. \u041E\u0431\u0435\u0437\u043B\u0438\u0447\u0438\u0432\u0430\u043D\u0438\u0435. \u041E\u0442\u0447\u0430\u044F\u043D\u0438\u0435. \u0418, \u0441\u0430\u043C\u043E\u0435 \u0441\u0442\u0440\u0430\u0448\u043D\u043E\u0435, - \u0443\u0442\u0440\u0430\u0442\u0430 \u0432\u0435\u0440\u044B.\n\u041E\u0434\u0438\u043D \u043C\u043E\u043C\u0435\u043D\u0442 \u043E\u0441\u043E\u0431\u0435\u043D\u043D\u043E \u043F\u043E\u0440\u0430\u0437\u0438\u043B \u043C\u0435\u043D\u044F: \u0432\u043E\u0437\u0433\u043B\u0430\u0441\u044B \u043C\u0430\u043B\u044C\u0447\u0438\u0448\u0435\u043A, \u043A\u043E\u0433\u0434\u0430 \u0422\u0430\u043C\u0430\u0440\u0443 \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u0443 \u0432\u0435\u043B\u0438 \u043A \u0437\u0434\u0430\u043D\u0438\u044E \u0441\u0443\u0434\u0430: \"\u041E\u0442\u043F\u0443\u0441\u0442\u0438\u0442\u0435 \u0435\u0451, \u0434\u044F\u0434\u044C\u043A\u0438!\" \u043E\u0434\u043D\u043E\u0433\u043E \u0438 \"\u0420\u0430\u0441\u0441\u0442\u0440\u0435\u043B\u044F\u0439\u0442\u0435 \u0415\u0435, \u043C\u0435\u0440\u0437\u0430\u0432\u043A\u0443!\" \u0434\u0440\u0443\u0433\u043E\u0433\u043E. \u041A\u0440\u043E\u0432\u044C \u0441\u0442\u044B\u043D\u0435\u0442 \u0432 \u0436\u0438\u043B\u0430\u0445...\n\u041D\u043E \u043D\u0435\u0441\u043C\u043E\u0442\u0440\u044F \u043D\u0430 \u0432\u0441\u0435 \u0437\u043B\u043E, \u043A\u043E\u0442\u043E\u0440\u044B\u043C \u043E\u043A\u0443\u0442\u0430\u043D\u0430 \u043B\u0430\u0433\u0435\u0440\u043D\u0430\u044F \u0436\u0438\u0437\u043D\u044C, \u0434\u043E\u0431\u0440\u043E[]\n\u0412 \u0436\u0438\u0437\u043D\u0438 \u0422\u0430\u043C\u0430\u0440\u044B \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u044B  \u0432 \u043D\u0443\u0436\u043D\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442 \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E \u043F\u043E\u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0447\u0435\u043B\u043E\u0432\u0435\u043A, \u043B\u044E\u0434\u0438, \u0442\u0430\u043A \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u0435 \u0435\u0439, \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u044E\u0449\u0438\u0435 \u0435\u0451 \u043D\u0430 \u0434\u0430\u043B\u044C\u043D\u0435\u0439\u0448\u0443\u044E \u0431\u043E\u0440\u044C\u0431\u0443: \u0427\u0438\u043D\u0433\u0438\u0437, \u0442\u0435\u0445\u043D\u043E\u0440\u0443\u043A \u041F\u043E\u0440\u0442\u043D\u043E\u0432, \u0412\u0430\u0441\u0438\u043B\u0438\u0439 \u0418\u0432\u0430\u043D\u043E\u0432\u0438\u0447 \u041B\u0443\u043A\u0430\u0448, \u0411\u0435\u043D\u044E\u0448, \u0412\u0435\u0440\u0430 \u041D\u0438\u043A\u043E\u043B\u0430\u0435\u0432\u043D\u0430, \u0432\u0441\u0442\u0440\u0435\u0447\u0430 \u0441 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 - \u0447\u0443\u0434\u0435\u0441\u043D\u043E\u0435 \"\u0437\u043D\u0430\u043C\u0435\u043D\u0438\u0435\", \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0435\u0440\u0435\u0433\u0448\u0435\u0435 \u0433\u0435\u0440\u043E\u0438\u043D\u044E \u043E\u0442 \u043E\u0442\u0447\u0430\u044F\u043D\u043D\u043E\u0433\u043E \u0448\u0430\u0433\u0430 \u043F\u043E\u043A\u043E\u043D\u0447\u0438\u0442\u044C \u0441\u043E\u0431\u043E\u0439, \u0410\u043B\u0435\u043A\u0441\u0430\u043D\u0434\u0440 \u041E\u0441\u0438\u043F\u043E\u0432\u0438\u0447. \u041D\u0435\u043B\u044C\u0437\u044F \u043D\u0435 \u0443\u043F\u043E\u043C\u044F\u043D\u0443\u0442\u044C \u043E\u0434\u0438\u043D \u044D\u043F\u0438\u0437\u043E\u0434, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043F\u0440\u043E\u0438\u0437\u0432\u0451\u043B \u043D\u0430 \u043C\u0435\u043D\u044F \u043E\u0441\u043E\u0431\u043E\u0435 \u0432\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043D\u0438\u0435: \u043A\u043E\u0433\u0434\u0430 \u043D\u0430\u0447\u0430\u043B\u043E\u0441\u044C \u043C\u0430\u0441\u0441\u043E\u0432\u043E\u0435 \u0438\u0437\u043D\u0430\u0441\u0438\u043B\u043E\u0432\u0430\u043D\u0438\u0435 \u0432 \u0431\u0430\u0440\u0430\u043A\u0435, \u0438 \u043F\u044F\u0442\u0435\u0440\u043E \u0431\u043B\u0430\u0433\u043E\u0440\u043E\u0434\u043D\u044B\u0445 \u0440\u044B\u0446\u0430\u0440\u0435\u0439 \u0443\u0431\u0435\u0440\u0435\u0433\u043B\u0438 \u0434\u0432\u0443\u0445 \u0431\u0435\u0437\u0437\u0430\u0449\u0438\u0442\u043D\u044B\u0445 \u0434\u0435\u0432\u0443\u0448\u0435\u043A \u043E\u0442 \u0443\u0433\u043E\u0442\u043E\u0432\u0430\u043D\u043D\u043E\u0433\u043E \u0438\u043C \u0443\u0436\u0430\u0441\u0430. \u0412 \u0442\u0430\u043A\u0438\u0435 \u043C\u043E\u043C\u0435\u043D\u0442\u044B \u043E\u0431\u0440\u0435\u0442\u0430\u0435\u0448\u044C \u043D\u0435\u043E\u0431\u044B\u0447\u0430\u0439\u043D\u0443\u044E \u0432\u0435\u0440\u0443...\u0412 \u043B\u044E\u0434\u0435\u0439, \u0432 \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u043D\u043E\u0441\u0442\u044C, \u0432 \u0434\u043E\u0431\u0440\u043E.\n\u042D\u0442\u0430 \u043D\u0435\u043E\u0431\u044B\u0447\u0430\u0439\u043D\u043E \u0441\u0438\u043B\u044C\u043D\u0430\u044F \u0436\u0435\u043D\u0449\u0438\u043D\u0430, \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u0430\u0432\u0448\u0430\u044F \u043F\u0435\u0447\u0430\u043B\u044C\u043D\u0443\u044E \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u0441\u0432\u043E\u0435\u0439 \u0442\u044F\u0436\u0435\u043B\u043E\u0439 \u0441\u0443\u0434\u044C\u0431\u044B \u0438 \u0441\u0443\u0434\u044C\u0431\u044B \u0435\u0435 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u0438\u043A\u043E\u0432, \u043D\u0435 \u043F\u0435\u0440\u0435\u0441\u0442\u0430\u0451\u0442 \u0443\u0434\u0438\u0432\u043B\u044F\u0442\u044C \u043D\u0430 \u043F\u0440\u043E\u0442\u044F\u0436\u0435\u043D\u0438\u0438 \u0432\u0441\u0435\u0439 \u043A\u043D\u0438\u0433\u0438. \n\n\u0411\u0443\u0434\u0443\u0447\u0438 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u043E\u043C \u0432\u043F\u0435\u0447\u0430\u0442\u043B\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u043C, \u043C\u043D\u0435 \u0431\u044B\u043B\u043E \u043D\u0435\u043B\u0435\u0433\u043A\u043E \u0447\u0438\u0442\u0430\u0442\u044C \u044D\u0442\u0443 \u043A\u043D\u0438\u0433\u0443, \u0441\u043B\u0435\u0437\u044B \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E \u043D\u0430\u0432\u043E\u0440\u0430\u0447\u0438\u0432\u0430\u043B\u0438\u0441\u044C \u043D\u0430 \u0433\u043B\u0430\u0437\u0430. \u0423\u0436\u0430\u0441, \u0438\u0441\u043F\u044B\u0442\u0430\u043D\u043D\u044B\u0439 \u0438 \u043E\u043F\u0438\u0441\u0430\u043D\u043D\u044B\u0439 \u0422\u0430\u043C\u0430\u0440\u043E\u0439 \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u043E\u0439, \u043D\u0435 \u0441\u043E\u043F\u043E\u0441\u0442\u0430\u0432\u0438\u043C \u043D\u0438 \u0441 \u0447\u0435\u043C. \n\u041F\u043E\u0440\u043E\u0439 \u043A\u0430\u0436\u0435\u0442\u0441\u044F, \u0447\u0442\u043E \u0432\u0441\u0435 \u044D\u0442\u043E \u043A\u0430\u043A\u043E\u0439-\u0442\u043E \u0434\u0440\u0443\u0433\u043E\u0439 \u043C\u0438\u0440, \u0434\u0440\u0443\u0433\u0430\u044F \u0432\u0441\u0435\u043B\u0435\u043D\u043D\u0430\u044F, \u0447\u0442\u043E \u0432\u0441\u0435 \u044D\u0442\u043E \u043F\u0440\u0438\u0434\u0443\u043C\u0430\u043D\u043E, \u0447\u0442\u043E \u0442\u0430\u043A\u043E\u0433\u043E \u043F\u0440\u043E\u0441\u0442\u043E \u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u0431\u044B\u0442\u044C. \u041D\u0430\u0441\u0442\u043E\u043B\u044C\u043A\u043E \u0436\u0443\u0442\u043A\u0438\u0435 \u0438 \u043D\u0435 \u0441\u043E\u043F\u043E\u0441\u0442\u0430\u0432\u0438\u043C\u044B\u0435 \u0441 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u044B\u043C \u043C\u0438\u0440\u043E\u043C \u0441\u043E\u0431\u044B\u0442\u0438\u044F \u043E\u043F\u0438\u0441\u0430\u043D\u044B \u0432 \u043A\u043D\u0438\u0433\u0435. \u041D\u043E \u043F\u043E\u0442\u043E\u043C \u0441\u043E\u043A\u0440\u0443\u0448\u0430\u0435\u0448\u044C\u0441\u044F, \u043F\u043E\u043D\u0438\u043C\u0430\u044F, \u0447\u0442\u043E \u0432\u0441\u0435 \u044D\u0442\u043E \u0433\u043E\u0440\u044C\u043A\u0430\u044F \u043F\u0440\u0430\u0432\u0434\u0430, \u043E\u043F\u0438\u0441\u0430\u043D\u043D\u0430\u044F \u0441 \u0442\u0430\u043A\u043E\u0439 \u0431\u043E\u043B\u044C\u044E, \u043D\u043E \u0432 \u0442\u043E\u0436\u0435 \u0432\u0440\u0435\u043C\u044F \u0431\u0435\u0437 \u043C\u0430\u043B\u0435\u0439\u0448\u0435\u0439 \u0438\u0441\u043A\u0440\u044B \u043D\u0435\u043D\u0430\u0432\u0438\u0441\u0442\u0438. \u0412\u043E\u043F\u0440\u0435\u043A\u0438 \u0432\u0441\u0435\u043C\u0443 \u0443\u0436\u0430\u0441\u0443 \u0441\u043E\u0431\u044B\u0442\u0438\u0439, \u044D\u0442\u0430 \u043A\u043D\u0438\u0433\u0430, \u043A\u0430\u043A \u0438 \u0441\u0430\u043C\u0430 \u0422\u0430\u043C\u0430\u0440\u0430 \u0412\u043B\u0430\u0434\u0438\u0441\u043B\u0430\u0432\u043E\u0432\u043D\u0430, \u0438\u0437\u043B\u0443\u0447\u0430\u0435\u0442 \u043A\u0430\u043A\u043E\u0439-\u0442\u043E \u0432\u043D\u0443\u0442\u0440\u0435\u043D\u043D\u0438\u0439 \u0441\u0432\u0435\u0442...\u041E\u043D \u0437\u0430\u0440\u0430\u0436\u0430\u0435\u0442 \u0438 \u0437\u0430\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0432\u0435\u0440\u0438\u0442\u044C...\u041F\u043E\u043D\u044F\u0442\u044C, \u0447\u0442\u043E, \u043D\u0430\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0431\u044B \u0431\u0435\u0437\u043D\u0430\u0434\u0435\u0436\u043D\u043E\u0439 \u043D\u0438 \u043A\u0430\u0437\u0430\u043B\u0430\u0441\u044C \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u044F, \u0432\u0441\u0435\u0433\u0434\u0430 \u043D\u0443\u0436\u043D\u043E \u043F\u0440\u043E\u0434\u043E\u043B\u0436\u0430\u0442\u044C \u0431\u043E\u0440\u043E\u0442\u044C\u0441\u044F!',

    function tUser(fromId) {
        if (fromId < 2000000000 && users[fromId]) {
            var user = users[fromId];
            return '<img src="' + user.photo200Orig + '" width="32" height="32"><br>' + user.firstName + ' ' + user.lastName;
        } else
            return 'o_0';
    }

    function tAttachments(attachments) {
        if (attachments) {
            var resultHtml = '';
            attachments.forEach(function (attachment) {
                switch (attachment.type) {
                    case 'photo':
                        resultHtml += '<a href="' + attachment.photo.photo604 + '" target="_blank"><img src="' + attachment.photo.photo130 + '" width="64" height="64"></a>';
                        break;
                    case 'sticker':
                        resultHtml += '<img src="' + attachment.sticker.photo64 + '" width="64" height="64">';
                        break;
                    case 'gift':
                        resultHtml += '<img src="' + attachment.gift.thumb96 + '" width="64" height="64">';
                        break;
                    case 'audio':
                        resultHtml += '[audio: ' + attachment.audio.title + '], ';
                        break;
                    case 'doc':
                        switch (attachment.doc.type) {
                            case 5:
                                resultHtml += '<a href="' + attachment.doc.url + '" target="_blank">[voice]</a>';
                                break;
                            default:
                                resultHtml += '[doc: ' + attachment.doc.title + '], ';
                                break;
                        }
                        break;
                    default:
                        resultHtml += attachment.type + ', ';
                        break;
                }
            });
            return resultHtml;
        } else return '';
    }
